import React from 'react';

import './MultiExApp.css';

import LatLongsComponent from './LatLongsComponent.js';

const defaultLatLongs = [{latitude: 63.1, longitude: 11.2}, {latitude: 63.2,longitude: 11.0}];

function MultiExApp() {
  return (
    <div id="MultiExApp">
		<LatLongsComponent latLongs={defaultLatLongs}/>
    </div>
  );
}

export default MultiExApp;
